import React from "react";
import { Switch, Route, Redirect } from "react-router-dom";

import Homepage from "../homepage/Homepage";
import LoginForm from "../auth/LoginForm";
import SignupForm from "../auth/SignupForm";
import NewToDoForm from "../habits/NewToDoForm";
import HabitList from "../habits/HabitList";
import PrivateRoute from "./PrivateRoute";


// Site-wide routes.
// Parts of site are only visitable when logged in. Those routes are
// wrapped by <PrivateRoute>, which is an authorization component.
// Visiting a non-existant route redirects to the homepage.

function Routes({ login, signup, createNewToDo,  }) {
  console.debug(
      "Routes",
      `login=${typeof login}`,
      `signup=${typeof signup}`,
  );

  return (
      <div className="pt-5">
        <Switch>

          <Route exact path="/">
            <Homepage />
          </Route>

          <Route exact path="/login">
            <LoginForm login={login} />
          </Route>

          <Route exact path="/signup">
            <SignupForm signup={signup} />
          </Route>

          <PrivateRoute exact path="/todos">
            <HabitList />
          </PrivateRoute>

          <PrivateRoute exact path="/todo">
            <NewToDoForm createNewToDo={createNewToDo}/>
          </PrivateRoute>

          <Redirect to="/" />

        </Switch>
      </div>
  );
}

export default Routes;
